import React from 'react'
import HeaderBar from '../components/HeaderBar'
import FootBar from '../components/FootBar'
import '../styles/Slido.css'
import a from '../data/shrek/1.png'
import b from '../data/shrek/2.png'
import c from '../data/shrek/3.png'
import d from '../data/shrek/4.png'
import e from '../data/shrek/5.png'
import f from '../data/shrek/6.png'
import g from '../data/shrek/7.png'
import h from '../data/shrek/8.png'

export default function Slido () {
    const [results, setResults] = React.useState([
        <img className="slido-blocks" src={a} alt="slido-img" />,
        <img className="slido-blocks" src={b} alt="slido-img" />,
        <img className="slido-blocks" src={c} alt="slido-img" />,
        <img className="slido-blocks" src={d} alt="slido-img" />,
        <img className="slido-blocks" src={e} alt="slido-img" />,
        <img className="slido-blocks" src={f} alt="slido-img" />,
        <img className="slido-blocks" src={g} alt="slido-img" />,
        <img className="slido-blocks" src={h} alt="slido-img" />,
        <div className="slido-blocks"></div>
    ])
    const [blocks, setBlocks] = React.useState([])

    function shuffleArray(array) {
        for (let i = array.length - 1; i > 0; i--) {
            const j = Math.floor(Math.random() * (i + 1));
            [array[i], array[j]] = [array[j], array[i]];
        }
    }

    React.useEffect(() => {
        setBlocks(shuffleArray(results))
    }, [])

    return (
        <div className="page-container">
            <HeaderBar />
            <div className="container">
                <div id="slido-container">
                    <div className="slido-block-rows">
                        {blocks[0]}
                        {blocks[1]}
                        {blocks[2]}
                    </div>
                    <div className="slido-block-rows">
                        {blocks[3]}
                        {blocks[4]}
                        {blocks[5]}
                    </div>
                    <div className="slido-block-rows">
                        {blocks[6]}
                        {blocks[7]}
                        {blocks[8]}
                    </div>
                </div>
                <div id="slido-btn-container">
                    <button id="slido-solve-btn">Solve</button>
                    <button id="slido-reset-btn">Reset</button>
                </div>
            </div>
            <FootBar />
        </div>
    )
}
